package com.sperez.jhs;

import org.junit.Test;
import java.nio.charset.Charset;
import static org.junit.Assert.*;

public class FileHandlingUtilsTest {
    static final String IMAGE_GIF = "";

    @Test
    public void testLengthOfByteArray() throws Exception {
        assertEquals("14", FileHandlingUtils.lengthOfByteArray("./public/file1"));
    }

    @Test
    public void testReadTextFile() throws Exception {
        assertEquals("file1 contents", FileHandlingUtils.readTextFile("./public/file1", Charset.defaultCharset()));
    }

    @Test
    public void testReadImageFile() throws Exception {
        assertEquals(IMAGE_GIF, FileHandlingUtils.readImageFile("./public/image.gif"));
    }
}